import React from "react";
const App=(prop)=>{
    const{x, y, z}=prop;
    if(x==y && y==z){
        return(<>
            <p>{x}   {y}   {z}</p>
            <h4>Wow Grape</h4>
        </>
        )
    }else{

        return(<> <p>{x}   {y}   {z}</p>
         <p>Not Machin</p>
        </>)}
}

export default App;
